import React from 'react';
import './Form.css'

class Form extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <form>
                <label id="lb1">Email ID: <input type="text" name="email"/></label>
                <label id="lb2">Password: <input type="password" name="password"/></label>
                <label id="lb3">Confirmation: <input type="password" name="confirmation"/></label>
                <input type="submit" value="Sign Up"/>
            </form>
    }
}
export default Form;
